function Logic() {
  const handleClick = (amount, length) => {
    if (amount === length) {
      return 0;
    } else if (amount === 0) {
      console.log(length);
      return 0;
    }
    return amount;
  };

  return {
    handleClick,
  };
}

export default Logic;
